import React from "react";
import { Container, Text } from "../styledComponents";
const Login = () => {
  return (
    <Container
      flex={1}
      color="red"
      row
      customStyles={{ minHeight: "100vh", maxHeight: "100vh" }}
    >
      <Container
        flex={0.65}
        row
        middle
        center
        color="transparent"
        customStyles={{ minHeight: "100%", maxHeight: "100%" }}
      >
        <Text>Image</Text>
      </Container>
      <Container
        flex={0.35}
        row
        middle
        center
        customStyles={{ minHeight: "100%", maxHeight: "100%" }}
      >
        <Text>forms</Text>
      </Container>
    </Container>
  );
};

export default Login;
